import { Typography, TextField, Button } from '@mui/material'
import React, { useState } from 'react'
import { memo } from 'react'
import './Home.css'
import SearchIcon from '@mui/icons-material/Search';



function Home() {
  const [symbol, setSymbol] = useState('')
  const [gotSymbol, setGotSymbol] = useState(false)

  return (
    <div className='home-container'>
      <div className='search-container'>
        <TextField id="outlined-basic" label="Search by Symbol" variant="outlined" className='search-symbol'/>
        <Button 
        variant="contained"
        color="primary"
        startIcon={<SearchIcon />}
        style={{flex: 'none',  marginLeft: '10px',  alignSelf: 'strech' }}>Search</Button>
      </div>
      
      <div>
        {!gotSymbol && (
          <Typography variant='h3' style={{
            
          }}>Stock Quote</Typography>
        )}
      </div>
        
    </div>
  )
}

export default memo(Home)
